// client/src/components/UserTypeSelection.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const UserTypeSelection = () => {
  const navigate = useNavigate();

  const handleTenantSelection = () => {
    navigate('/signup-tenant');
  };

  const handleLandlordSelection = () => {
    navigate('/signup-landlord');
  };

  const buttonStyle = {
    padding: '10px 20px',
    fontSize: '16px',
    margin: '10px',
    borderRadius: '4px',
    cursor: 'pointer',
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '50px' }}>
      <h1>Select User Type</h1>
      <button style={{ ...buttonStyle, backgroundColor: '#4CAF50', color: 'white' }} onClick={handleTenantSelection}>
        Tenant
      </button>
      <button style={{ ...buttonStyle, backgroundColor: '#2196F3', color: 'white' }} onClick={handleLandlordSelection}>
        Landlord
      </button>
    </div>
  );
};

export default UserTypeSelection;
